import React from 'react';
import './CartPage.css';

function CartPage({ cart }) {
  return (
    <div className="cart-page">
      <h1>카트</h1>
      {cart.length === 0 ? (
        <p>카트에 담긴 상품이 없습니다.</p>
      ) : (
        <ul className="cart-list">
          {cart.map((item, index) => (
            <li key={index} className="cart-item">
              <h3>{item.name}</h3>
              <p>{item.price.toLocaleString()}원</p>
              <p>{item.description}</p>
            </li>
          ))}
        </ul>
      )}
    </div>
  );
}

export default CartPage;
